window.bookSummaryJSON = "Drawing from the text of the <i>BusinessWeek</i> best seller <i>Today Matters</i>, this condensed, revised edition boils down John C. Maxwell's 12 daily practices to their very essence, giving maximum impact in minimal time. <p>This version is designed to be listened to in one sitting, or taken in as brief lessons in a few spare minutes each day. It covers such topics as:</p> <p></p> <li> Priorities<br></li> <li> Health<br></li> <li> Family<br></li> <li> Finances<br></li> <li> Values<br></li> <li> Growth<p></p><p>Listeners will learn how to make decisions on important matters and apply those decisions daily to put them on a path to more successful, productive, and fulfilling lives.</p></li>"; 
